  \"2016-07-27T22:45:53.806180\",\n\t\"name\": \"narrative-report-fish-springs-national-wildlife-refuge-dugway-utah-january-december-1967\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Fish Springs
  National Wildlife Refuge outlines Refuge accomplishments during the 1967 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, collections and receipts, vegetation
  control, and prescribed fire. Resource management is outlined; topics include fur
  harvesting, commercial frog ranchng, and peat mining. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest, N-R forms, and photographs are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
